Male genitalia:
Pygofer less than twice as long as wide, moderately projected posteriorly; apex narrow, rounded, and with long macrosetae dispersed along the distal third (
Fig. 18a
). Valve slightly quadrate, wide, triangular in the middle. Plates long, with a fold on the margins and filamentous setae (
Fig. 18b
). Style with apophysis elongate, straight, apex truncate (
Fig. 18c
). Aedeagus in ventral view with basal portion wide and curved; shaft straight, apex truncate and shorter than ventral processes (
Fig. 18d
). Ventral processes arising a third of the way along the length, straight, apices tapered (pointed) and directed outward (
Fig. 18d
). Shaft in lateral view curved dorsad, truncate at apex; dorsal projection short, straight, truncate. Gonopore apical. Ventral processes straight, apices sharp (
Fig. 18e
).
